(11, 3, '邀请好友,这些奖品任你挑选', '', '<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<img src="/data/upload/editer/image/2016/11/30/583eced50cb97.jpg" alt="" /> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n活动奖品：（满足活动条件，以下商品可以任选1件 ）<br />\r\n<br />\r\n一、奖品（烘鞋器1只）<br />\r\n<br />\r\n<img src="/data/upload/editer/image/2016/11/30/583ecb00aac9b.png" alt="" /><br />\r\n<br />\r\n二、奖品（安徒生童话4本）<br />\r\n<br />\r\n<img src="/data/upload/editer/image/2016/11/30/583ecb0101482.png" alt="" /><br />\r\n<br />\r\n三、奖品（加厚垃圾袋1包）<br />\r\n<br />\r\n<img src="/data/upload/editer/image/2016/11/30/583ecb0150375.png" alt="" /><br />\r\n<br />\r\n四、奖品（云南玫瑰饼10枚）<br />\r\n<br />\r\n<img src="/data/upload/editer/image/2016/11/30/583ecb01aecb9.png" alt="" /><br />\r\n<br />\r\n五、奖品（凡士林护手霜2支）<br />\r\n<br />\r\n<img src="/data/upload/editer/image/2016/11/30/583ecb024949e.png" alt="" /><br />\r\n<br />\r\n<br />\r\n<br />\r\n活动时间：11月30日21点 ---&nbsp;12月2日 24:00<br />\r\n任务描述：<br />\r\n&nbsp;邀请10位以上微信好友加入微信群<br />\r\n活动规则：<br />\r\n1. 只限女性好友(注：做微商的好友禁止邀请)<br />\r\n2. 每邀请1位好友，请告知群主，便于群主统计<br />\r\n3. &nbsp;最终人数统计时间为12月3日<br />\r\n4. 所有奖品12月3日发出<br />\r\n5. 活动结束群主会联系满足条件的群友。确定收货地址和喜欢的商品，全部免费快递到家。<br />\r\n<br />', 0, 255, 1480509244, 0, 1, '', '', '', 0, '/data/upload/editer/image/2016/11/30/583eced50cb97.jpg'),
